INSERT INTO aq_sg_info VALUES ('201208141718001003', '201207231849171015', '1#锅炉', '2012-07-21 00:00:00', '03', '01', '2', '0', '无', '0', '0', '0', '0', '0', '0', 'lianzt', '2012-08-14 17:18:00', '02', '1、公司副总经理付苏利分管设备工作，负领导管理责任，罚款2000元。\r\n2、机动部部长辛晓负设备监督管理责任，罚款1000元。\r\n3、热电分厂设备副厂长王红星负现场管理责任，罚款1000元。', '　　　提高外围检修施工质量的监督力度，切实保证外围检修施工质量。\r\n　　　将锅炉水汽比做到DCS上，加趋势图，便于提前发现漏点，及时采取措施，避免事故的进一步扩大。\r\n　　　增加一台备用锅炉，便于锅炉维护检修期间确保系统蒸汽平衡。\r\n　　　4、完善加强设备运行记录台账，掌握设备运行周期，提高锅炉预知检修的能力。', '公司领导，机动部，安环部，生产技术部相关人员', '乔占录', 'lianzt', '2012-08-14 17:25:53', '1', null, null);
INSERT INTO aq_sg_info VALUES ('201208141718001004', '201207231849171015', '1#锅炉', '2012-07-21 00:00:00', '03', '01', '2', '0', '无', '0', '0', '0', '0', '0', '0', 'lianzt', '2012-08-14 17:18:00', '02', '1、公司副总经理付苏利分管设备工作，负领导管理责任，罚款2000元。\r\n2、机动部部长辛晓负设备监督管理责任，罚款1000元。\r\n3、热电分厂设备副厂长王红星负现场管理责任，罚款1000元。', '　　　提高外围检修施工质量的监督力度，切实保证外围检修施工质量。\r\n　　　将锅炉水汽比做到DCS上，加趋势图，便于提前发现漏点，及时采取措施，避免事故的进一步扩大。\r\n　　　增加一台备用锅炉，便于锅炉维护检修期间确保系统蒸汽平衡。\r\n　　　4、完善加强设备运行记录台账，掌握设备运行周期，提高锅炉预知检修的能力。', '公司领导，机动部，安环部，生产技术部相关人员', '乔占录', 'lianzt', '2012-08-14 17:25:53', '2', null, null);
INSERT INTO aq_sg_info VALUES ('201208180814081001', '201207231849431018', '总降变电所', '2012-07-26 00:00:00', '03', '08', '0', '0', '无', '0', '0', '0', '0', '0', '0', 'lianzt', '2012-08-18 08:14:08', '01', '　1、公司副总经理付苏利分管设备及电仪工作，负主要领导管理责任，罚款5000元。\r\n  2、电仪分厂电气副厂长焦连军，主管全厂电气维护及运行，日常管理不到位，负主要管理责任，免去副厂长职务。\r\n  3、电仪分厂电气主任工程师路宏亮负管理责任，罚款2000元。\r\n  4、机动部电气技术员白有春负管理责任，罚款1000元。\r\n  5、电仪分厂技术员邢光磊负管理责任，罚款1000元。', '　1、退出1#主变绕组超温跳闸保护压板，保留信号报警和其它跳闸保护压板。\r\n　2、退出2#及4#主变超温跳闸保护压板。\r\n　3、利用生产装置停车检修时间更换1#主变温度控制器（厂家已发温度控制器），并将有可能导致主变及车间变压器误跳闸的相关保护装置如瓦斯继电器、压力释放阀等全部送至专业检测机构进行性能检测，同时对有载调压开关进行直流电阻测试。\r\n　4、利用生产装置停车检修时间对高压电器设备保护装置进行认真检测，排除隐患。\r\n　5、增加运行人员监盘和现场巡检频次，并列入交接班记录内容。\r\n　 6、加大隐患排查力度，加强负荷平衡协调，确保高负荷下设备稳定运行。\r\n　7、发现温度偏高（大于60度）时采取降温措施，并制定特护方案，杜绝类似事故的再次发生。', '公司领导，安环部，机动部，生产部相关技术人员', '乔占录', 'lianzt', '2012-08-18 08:16:37', '2', null, null);
INSERT INTO aq_sg_info VALUES ('201208180834391002', '201207231849241016', '空分现场', '2012-07-28 00:00:00', '02', '08', '0', '0', '无', '0', '0', '0', '0', '0', '0', 'lianzt', '2012-08-18 08:34:39', '01', '　1、公司总经理闫军，作为公司安全生产第一责任人，对此次事故负管理责任，罚款5000元。\r\n　2、公司副总经理刘金付，分管公司生产、技术、安全工作，对此次事故负管理责任，罚款5000元。\r\n　3、热电分厂厂长张杰作为分厂安全生产第一责任人，负有管理责任，罚款3000元。\r\n　4、热电分厂副厂长赵彦，负责分厂水处理工艺技术管理工作，管理不到位，罚款3000元。\r\n　5、热电分厂工艺技术员张永进，负责循环水工艺技术管理工作，负有直接管理责任，罚款3000元。\r\n　　　6、公司生产技术部副部长闫建国，负有生产技术管理责任，罚款1500元。\r\n　　　7、循化水主操马龙负直接责任，罚款1000元。\r\n8、热电分厂水处理班长董斌负管理责任，罚款1000元。', '　1、生产技术部着手完善修订操作规程，完善各岗位操作要点、安全防范措施，切实发挥操作指导作用。\r\n　2、加强员工的培训力度，特别是岗位操作人员的岗位操作培训，举一反三，防患于未然。\r\n　3、加强循环水药剂管理，严格按照入库管理进行药剂验收；完善分析办法，使分析对药剂投放具有指导作用。\r\n　4、成立公司级水质稳定小组，加强循环水工艺管理，严格按照操作规范投加药剂。\r\n　5、强化生产调度协调指挥系统，完善生产调度汇报制度，提高生产调度统一协调能力。', '公司领导，机动部，安环部，生产部相关人员', '乔占录', 'lianzt', '2012-08-18 08:36:25', '2', null, '事故造成系统停车10小时，没有造成直接经济损失。');
INSERT INTO aq_sg_info VALUES ('201208290809141001', '201207231849331017', '变压吸附现场', '2012-08-20 00:00:00', '05', '08', '0', '0', '无', '0', '0', '0', '0', '0', '0', 'lianzt', '2012-08-29 08:09:15', '01', '　　　1、8月份双基建设考核扣甲醇分厂2分；\r\n　　　甲醇分厂厂长任有生是第一安全生产责任人，负管理责任，罚款300元；\r\n　　　甲醇分厂变压吸附临时负责人胡志远负管理责任，罚款300元；\r\n　　　甲醇分厂检修工作临时负责人李爱国负管理责任，罚款300元；\r\n　　　变压吸附班长张银涛负直接管理责任罚款300元；\r\n　　　变压吸附当班主操李盼盼和现场巡检工周瑞星负直接责任罚款200元。', '　1、甲醇分厂要深刻吸取本次事故教训，针对事故暴露出的问题认真开展隐患排查治理活动，消除此类潜在安全隐患；\r\n　2、加强员工的培训力度，特别是岗位操作人员的岗位操作知识培训和安全技能培训，举一反三，防患于未然；\r\n　3、严格执行落实岗位巡回检查制度，及时发现安全生产事故隐患；\r\n　4、认真落实设备包机制度，做好设备日常养护、维护工作，消除设备缺陷；', '辛晓、闫建国、乔占录、路红亮、任永喜、周龙等人', '乔占录', 'lianzt', '2012-08-29 08:12:10', '2', null, null);
