INSERT INTO sc_rzs VALUES ('2012-10-24', '热电1-3#锅炉运行，产汽350t/h，负荷77%，发电机运行，发电量14000KW.h/h，负荷56%，脱盐水1#、2#、3#RO运行，水箱液位7.8m，循环水1期1-3#汽机泵运行，2期2#、5#电泵运行。锅炉1#给水泵检修，2#高加待检，1#炉对空排汽及安全阀微漏，2#炉西包墙管微漏，3#炉一次风机监护运行，3#炉主蒸汽流量计根部阀漏汽，脱盐水2#冷凝液泵振动稍大。', '空分运行正常，产氧量37000NM3/h，负荷93%，氧泵B泵监护运行，空分增压机一、二段出口漏气，停车后处理;气化A/B炉3.86MPa运行，A炉氧量16100NM3/h，负荷103%，O/C 0.69，B炉氧量15400NM3/h，负荷99%，O/C 0.70。A炉1026B、1027A温度偏高。', '甲醇变换，低温甲醇洗，合成，精馏稳定运行，精馏污水管线堵塞；PSA进气量50000NM3/h，CO外送13000NM3/h，2#解析气压缩机检修，2#CO2压缩机待修。', 'songlina', '宋丽娜', '2013-01-07 09:37:54', 'CO流量12000NM3/h，H2流量32000NM3/h，系统65%负荷运行,因系统循环气成分不佳，CO和H2均有放空，系统正在做调整。');
INSERT INTO sc_rzs VALUES ('2012-10-29', '热电3台锅炉运行，产汽量340t/h，负荷76%，发电量10700kw.h，负荷42%。脱盐水2#、3#RO运行，水箱水位7.8m。循环水一期1#、2#、3#汽机泵运行，二期2#、5#电泵运行,14:55停2期1#循环水电泵。锅炉1#给水泵检修，2#高加待检，1#炉对空排汽及安全阀微漏，2#炉西包墙管微漏，3#炉一次风机液耦漏油，监护运行,13:35-14:35分B空压机试运行，15:30分循环水2期预膜完成，停止加药。污水处理事故水池液位高。', '空分运行正常，产氧量37000NM3/h，负荷98%，液氧泵B特护运行，19:50 分子筛加热器进口阀门KV4212仪表空气管断，纯化系统暂停，21:00 阀门检修完成，纯化系统运行。20:50 因气化A炉破渣机密封漏，A气化炉停运，气化B炉3.84MPa运行，O/C 0.7，负荷95%。', '20:50 变换、低温甲醇洗、合成低负荷运行，20:20 精馏停运，酸性气浓缩，21:00分析硫化氢浓度7%，硫回收检修，21:43停氢回收，20:50因气化A炉停车，PSA减负荷运行，进气量33000NM3/h，氢气外送18000NM3/h，CO外送8500NM3/h。', 'songlina', '宋丽娜', '2013-01-02 15:43:38', '19:27 乙二醇开始减负荷，CO流量8500NM3/h，H2流量18000NM3/h，O2流量1800NM3/h，35%负荷，产品质量：一等品。						\r\n');
INSERT INTO sc_rzs VALUES ('2012-11-26', '1#、2#锅炉运行，发电机组运行，脱盐水运行，循环水一期1#、3#汽机水泵运行。', '空分26日11:50空分液氧泵停，12:05膨胀机停，27日2:00 40HV4008阀处理完毕，6:30富氧液空排液阀修好，7:00启动膨胀机；气化26日9:08停车，14水循环运行，检查S-1103B发现有滤袋烧坏现象。', '甲醇系统26日9:39分合成气压缩机停车，27日3:50合成气压缩机探头检修完毕。', 'songlina', '宋丽娜', '2012-12-20 16:22:00', null);
INSERT INTO sc_rzs VALUES ('2012-11-27', '1#、2#锅炉运行。产量257T/h，负荷86%，发电机组运行，发电9100KW.H/H,负荷36.5%，脱盐水运行，脱盐水水箱液位8.2m，循环水一期1#、3#汽机水泵运行，27日17:302#汽机泵冲转，19:00并网运行。', '空分27日13:50空分启液氧泵，13:55启液氮泵，15:30 0.05MPa氮气外送；气化27日23:58气化B炉因摄像头坏点火未成功，28日2:00摄像头检修好，2:09分B炉点火，2:34投煤，6:00气化A炉点火，6:58分气化A炉投煤。', '甲醇系统27日14:20合成气压缩机3.8MPa，1.27MPa蒸汽暖管，15:402#CO2压缩机启动，16:01合成气压缩机冲转，16:40合成升温，28日3:50 3#CO2压缩机启动，4:50变换接气暖管。', 'songlina', '宋丽娜', '2012-12-21 08:07:16', null);
INSERT INTO sc_rzs VALUES ('2012-11-28', '1#、2#锅炉运行。产量265T/h，负荷88%，发电机组运行，发电6140KW.H/H,负荷25%，脱盐水运行，脱盐水水箱液位7.4m，循环水一期1#、2#、3#汽机水泵运行。', '空分运行正常，产氧量25500NM3/h,负荷64%；气化28日9:10因粉煤过少，气化A炉停车，29日00:35因气化B炉误操作，导致B洗涤塔出口阀全关，放空阀打开 ,1:10向变换送气，0:25气化A炉点火，1:21A炉投煤，4:16A炉并气', '甲醇29日00:35因气化误操作变换切气，1:30变换接气，3:46合成接气，精馏运行正常。', 'songlina', '宋丽娜', '2012-12-21 08:08:24', null);
INSERT INTO sc_rzs VALUES ('2012-11-29', '1#、2#锅炉运行。产量265T/h，负荷88%，发电机组运行，发电6140KW.H/H,负荷25%，脱盐水运行，脱盐水水箱液位7.4m，循环水一期1#、2#、3#汽机水泵运行。', '空分运行正常，产氧量25500NM3/h,负荷64%；气化28日9:10因粉煤过少，气化A炉停车，29日00:35因气化B炉误操作，导致B洗涤塔出口阀全关，放空阀打开 ,1:10向变换送气，0:25气化A炉点火，1:21A炉投煤，4:16A炉并气', '甲醇29日00:35因气化误操作变换切气，1:30变换接气，3:46合成接气，精馏运行正常。', 'songlina', '宋丽娜', '2012-12-21 08:11:56', null);
INSERT INTO sc_rzs VALUES ('2012-11-30', '1#、2#锅炉产汽200t/h，负荷67%；发电机发电2800KW.h/h，负荷11%；脱盐水2#、3#RO运行，水箱液位8.4m。11月30日08:16因外电晃电，循环水1#汽机泵跳车，启动电泵；8:401#汽机泵冲转，9:35并网，停电机泵；循环水2#、3#汽机泵正常运行。', '11月30日08:16因外电晃电，空分机组跳车，9:34机组冲转，13:40合格氧气、氮气外送，现产氧32000Nm3/h，负荷80%。因晃电，气化A/B炉紧急停车；18:12B炉点火，18:20A炉点火，20:53外送合格粗煤气；12月1日05:30气化A/B炉压力提至3.8MPa运行；A炉：O/C 0.65 负荷94%，B炉：O/C 0.65 负荷91.6%。', '11月30日08:16因外电晃电，系统停车。20:53变换接气，21:35低温甲醇洗接气，22:15精馏开车，12月1日02:40合成接气升温，03:50合成正常生产，06:40氢回收、硫回收开车。合成负荷90%。', 'songlina', '宋丽娜', '2012-12-21 10:00:35', null);
INSERT INTO sc_rzs VALUES ('2012-12-01', '1#、2#锅炉产汽205t/h,负荷68%；发电机发电2600KW.h/h,fuhe 10.5%；脱盐水1#、2#RO 运行，水箱液位7.1m。3#锅炉一次风机液力耦合器处理完毕。1#、2#、3#汽机泵运行。', '空分运行正常，产氧量33500NM3/H，负荷84%；气化A炉102%负荷、B炉95%负荷运行。12月1日气化B炉因输煤架桥22:30-24:00减负荷至73%，2日0:00-5:00气化B炉加负荷至98%；2日5:20因B炉带水严重减负荷至94%。', '系统工况优化，PSA保压2.87MPa.', 'songlina', '宋丽娜', '2012-12-21 10:39:40', null);
INSERT INTO sc_rzs VALUES ('2012-12-02', '1#、2#锅炉产气210t/h,负荷70%；发电机发电4670Kwh/h,负荷18.7%；脱盐水1#反渗透运行，水箱液位8.2m.3#锅炉一次风机检修。', '空分运行正常，产氧量33000NM3/h，负荷85%；气化A炉压力3.89MPa、负荷102%，B炉压力3.91MPa、负荷100%运行。', '系统工况优化，PSA保压3.0MPa.', 'songlina', '宋丽娜', '2012-12-21 14:47:47', null);
INSERT INTO sc_rzs VALUES ('2012-12-03', '1#、2#锅炉产汽210t/h，负荷70%；发电机发电3000KW.h/h，负荷12%；脱盐水2#、3#RO运行，水箱液位7.61m。4日00:35 3#锅炉油枪点火,6:00投煤，7:00并气；循环水一期1#、2#、3#汽机泵运行，二期2#电泵运行。', '空分运行正常，产氧量33666NM3/h,负荷88%；气化A炉压力3.93MPa、负荷100%，B炉压力3.96MPa、负荷100%运行。', '系统工况优化，PSA真空泵、1#解析气压缩机、1#置换气压缩机试车。变换运行正常，6:30低温甲醇洗二塔精碳洗塔投入运行，7:10因合成气压缩机组出现异常（一段分离器液位过高，导致机组喘振），合成切气，从低温甲醇洗后放空；精馏运行正常。', 'songlina', '宋丽娜', '2012-12-21 14:55:09', null);
