INSERT INTO sc_rzs VALUES ('2012-12-05', '1#、2#锅炉运行正常，产汽207t/h，5日11:13分2#锅炉并汽，11:23分停3#锅炉，引风机与西侧冷渣机5日白天检修完成，3#锅炉冷备，发电机运行，发电量3300KW.H/H，脱盐水运行正常，水位6.8m，循环水一期1-3#汽机泵运行，二期循环水置换，2#电泵运行，5日11:20启动1#电泵。', '空分运行正常，产氧34600NM3/H，负荷87%，气化A/B炉3.9MPa运行，A炉负荷104%，B炉负荷100%，B炉液位较低，监护运行。', '变换正常运行，低温甲醇洗净化气合格，合成、精馏运行正常，硫回收检修，5日15:13因CO吸附塔A塔3阀、4阀泄漏PSA停用原料气，6日0:20 3阀、4阀修好，开始气密，1:30PSA接气开车，2:40解析气送合成，6:00氢产品气合格，CO产品气未合格，6日00:30分永金公司停用高压氮气，5日11:42至16:18分项乙二醇送新鲜甲醇。', 'songlina', '宋丽娜', '2012-12-21 14:58:23', null);
INSERT INTO sc_rzs VALUES ('2012-12-06', '1#、2#锅炉运行正常，产汽210t/h，发电机运行，发电量4000KW.H/H，6日22:28 因9.8MPa减3.82MPa减压阀从38%开至98%，造成3.82MPa蒸汽管网压力超压安全阀起跳；脱盐水运行正常，水位7.8m，循环水一期1-3#汽机泵运行，二期循环水置换，1#、2#电泵运行。', '空分运行正常，产氧34600NM3/H，负荷87%；氩系统调试。气化A/B炉3.9MPa运行，A炉负荷103%，B炉负荷102%，B炉液位较低，监护运行,B气化炉激冷室液位低报警值变更为28%。', '变换正常运行，低温甲醇洗净化气硫含量超标(5:00数据：COS：0.21ppm)，合成、精馏、变压吸附运行正常，硫回收检修；15:20变换汽提塔冷凝液全部外排至污水事故水池，变压吸附产品气CO、H2合格。', 'songlina', '宋丽娜', '2012-12-21 15:01:29', null);
INSERT INTO sc_rzs VALUES ('2012-12-07', '1#、2#锅炉运行正常，产汽225t/h，发电机运行，发电量4300KW.H/H；脱盐水运行正常，水位7.8m，循环水一期1-3#汽机泵运行，二期循环水置换，1#、2#电泵运行,12月7日 18:16开循环水二期4#电泵，', '空分运行正常，产氧33800NM3/H，负荷89%；氩系统调试。12月7日 9:05气化B炉因煤线断煤停车， 16:00气化B炉投煤，16:45空分膨胀机因40VXA4409BA振动最高38.05跳车，随即启动。 18:00气化B炉并气', '12月7日 16:06变换接气暖管，16:30低温甲醇洗接变换气，16:35驰放气送气化热风炉（C2201送出），18:55合成接净化气开车，18:19精馏开车，21:45变压吸附接净化气，22:45开2#解析气压缩机，21:58开CO真空泵C.D.O，氢气真空泵A，0:40开置换气压缩机。乙二醇: 2:00 9.8蒸汽管线暖管。', 'songlina', '宋丽娜', '2012-12-21 15:02:46', null);
INSERT INTO sc_rzs VALUES ('2012-12-08', '1#、2#锅炉运行正常，产汽262t/h，负荷97%；发电机运行，发电量4400KW.H/H，负荷17%；脱盐水运行正常，水位6m；循环水一期1-3#汽机泵运行，17:17-18:00,电机泵投运，因3#汽机泵油滤器压差高0.1MPa，倒油过滤器；二期循环水置换，1#、2#、4#电泵运行。', '空分运行正常，产氧33800NM3/H，负荷89%；氩系统调试。气化A/B炉3.87MPa运行，氧气量16000NM3/h,A炉O/C  0.62,负荷102%，B炉O/C  0.70，负荷100%。', '变换系统运行正常，C2001冷凝液回收至污水处理；低温甲醇洗净化气COS仍超标，1.4PPm（21:00），合成负荷93%，精馏运行，硫回收液硫槽补焊。变压吸附工序：系统工况优化调整，19:40-20:40 CO压缩机试车，21:23原料气进气量由4000调整为6000NM3/h。19:00去乙二醇2.5减1.7MPa自力式调节阀处理完毕；17:30 C201机组开始冲转，18:40转速4750rpm；加氢系统气密，合成系统用1.7MPa蒸汽升温。', 'songlina', '宋丽娜', '2012-12-21 15:03:46', null);
INSERT INTO sc_rzs VALUES ('2012-12-09', '6:20 3#锅炉点火,9:20 投煤，发现3#锅炉蒸汽并汽阀漏气，带压堵漏，16:40 3#锅炉并汽。9:15 3#汽机循环水泵因检修凝结水泵，导致真空度降低，紧急停车，同时启动一期电机循环水泵，14:15 3#汽机泵冲转，16:00 3#汽机泵并网，停电机循环水泵', '空分运行正常，产氧33800NM3/H，负荷89%；氩系统调试。气化A/B炉3.82MPa运行，A炉氧气量15600NM3/h,O/C  0.58,负荷100%，B炉氧气量15900NM3/h，O/C  0.68，负荷102%。5:14 气化A炉因给料罐与蒸汽氧气混合气压差低跳车，A炉10:54点火，11:11投煤，13:25开始并气。', '变换系统运行正常，C2001冷凝液回收至污水处理；低温甲醇洗净化气COS仍超标，0.21PPm，13:25精馏开车，硫回收加热熔硫。变压吸附工序：系统工况优化调整，原料气进气量4800NM3/h。乙二醇气密消漏，C201运行，精馏运行。', 'songlina', '宋丽娜', '2012-12-21 15:04:44', null);
