INSERT INTO sc_rzs VALUES ('2013-02-08', '热电1-3#锅炉运行，产汽320t/h，负荷71%，发电机运行，发电量13500KW.H/H，负荷54%，脱盐水1#、2#、3#RO运行，水箱液位7.6m，循环水1期1-3#汽机泵运行，2期2#、4#电泵运行。', '空分运行正常，产氧35800NM3/h，负荷89%。气化A炉3.71MPa运行，O/C 0.61,氧量15600NM3/h，负荷101%。6:23气化B炉点火，7:15 B炉投煤,9:40 B炉并气完成；4:05真闪罐本体漏，16:10真闪罐堵漏结束；16:20 S-1201至V-1201管线清堵结束，X-1206A回装。17:10 P-1406C泵回装结束，待试。P1404泵清堵。B洗涤塔黑水至高闪管线堵塞，待处理。', '变换，低温甲醇洗，合成运行，9:40 B炉并气，甲醇加负荷系统工况调整，12:35 PSA进气加至32000NM3/h，CO外送9000NM3/h，H2外送19000 NM3/h。', 'songlina', '宋丽娜', '2013-02-09 09:09:58', '50%负荷运行。');
INSERT INTO sc_rzs VALUES ('2013-02-09', '热电1-3#锅炉运行，产汽400t/h，负荷89%，发电机运行，发电量12600KW.H/H，负荷50%，脱盐水1#、2#、3#RO运行，水箱液位8.12m，循环水1期1-3#汽机泵运行，2期2#、4#电泵运行。厂外三台生产水泵运行，雨水泵站排水置换。', '空分运行正常，产氧33900NM3/h，负荷89%。气化A炉3.57MPa运行，O/C 0.60,氧量8900NM3/h，负荷57%。气化B炉3.57MPa运行，O/C 0.68,氧量8600NM3/h，负荷55%。16:05耙料机因电流高跳车。16:40 P1404C泵堵停车。21:40 P1404A/B泵入口管线配管结束。00:55 P1404B/C泵清堵后投运。', '系统减负荷，工况优化。PSA进气量35000NM3/h。17:30精馏全回流，21:30增开1#解析气压缩机。23:40 CO停止外送。23:55停CO解析气压缩机。00:20停3#解析气压缩机。', 'songlina', '宋丽娜', '2013-02-10 09:42:55', '16:30开始减负荷，20:44 T101B切氧、T101A减氧至600N/M3，23:31T101A切氧，23:41系统切CO脱氢系统保温保压；00:02停T501、C501。');
