INSERT INTO sc_rzs VALUES ('2013-03-05', '热电1-3#锅炉运行，产汽345t/h，负荷76%，发电机组运行，发电量12500KW.H/H，负荷50%，脱盐水1#、2#RO运行，水箱液位7.7m，循环水一期1-3#汽机泵运行，二期2#、4#电泵运行。3#高压给水泵监护运行，发电机二次脉冲油油管漏待修,烟气脱硫运行。10:10-17:10检修高加进汽阀PV582040。', '空分运行，产量34812NM3/h，负荷87%，气化A炉3.85MPa运行，O/C 0.70，负荷96%，气化B炉3.86MPa运行，O/C 0.72，负荷101%。气化A炉渣口压差高（50KPa左右），监护运行。14:50气化A炉因带水严重减负荷至15100NM3/h，12:00-14:28汽轮机进汽侧轴振值波动三次，最高54um，监护运行。', '合成负荷60%，精馏负荷60%，PSA进气量40000NM3/h，外送CO 11000Nm/h、H2 23000Nm/h。9:53因PSA检修PT4008引起CO流量波动，乙二醇联锁跳车，11:26应乙二醇要求，减原料气量至30000NM3/h，14:00应乙二醇要求PSA加进气量至38000NM3/h，18:25 PSA加负荷至40000NM3/h，CO真空泵9台运行(C/D/E/F/I/K/M/N/P)，5台备用（A/G/H/L/O），2台待检(B/J)。硫回收继续扫硫清堵。', 'songlina', '宋丽娜', '2013-03-06 09:46:04', '乙二醇负荷50%，09:59乙二醇因脱氢塔压力联锁跳车，退氧切气，11:27乙二醇接气配氧。1:00 CO产品气中CH4含量0.94%。');
INSERT INTO sc_rzs VALUES ('2013-03-06', '热电1-3#锅炉运行，产汽345t/h，负荷76%，发电机组运行，发电量12500KW.H/H，负荷50%，脱盐水2#、3#RO运行，水箱液位8.2m，循环水一期1-3#汽机泵运行，二期2#、4#电泵运行。3#高压给水泵监护运行，发电机二次脉冲油油管漏待修,烟气脱硫运行。13:30发电机高调门波动一次,16:40 1#RO化学清洗。', '空分运行，产量35000NM3/h，负荷88%，气化A炉3.81MPa运行，O/C 0.65，负荷98%，气化B炉3.80MPa运行，O/C 0.71，负荷101%。气化A炉渣口压差高（75KPa）监护运行。03:40 C磨煤机检修结束，14:00因S1103B滤袋漏停B磨，启C磨，14:45气化A炉因渣口压差大减负荷至96%（高至120KPa）22:30 P1404B泵修复，备用', '合成负荷60%，精馏负荷60%，PSA进气量40000NM3/h，外送CO 11000Nm/h、H2 23000Nm/h。11:06 PSA因CO产品气中CH4高,减原料气量至36000NM3/h，14:50加原料气量至38000NM3/h，14:45为控制气化A#炉渣口压差，低温甲醇洗压力降至3.0MPa，16:40 4#CO2压缩机修复，待试。21:00净化气分析COS：0.13ppm，CO真空泵9台运行(C/D/E/F/I/K/M/N/P)，6台备用（A/G/H/L/O/J），1台待检(B)。', 'songlina', '宋丽娜', '2013-03-07 09:22:33', '永金负荷50%。09:11检修101罐后调节阀FV1003，18:30处理完毕。1:00 CO产品气中CH4含量1.14%。');
INSERT INTO sc_rzs VALUES ('2013-03-07', '热电1-3#锅炉运行，产汽340t/h，负荷75%，发电机组运行，发电量12500KW.H/H，负荷50%，脱盐水2#、3#RO运行，1#RO化学清洗，水箱液位 6.1m，循环水一期1-3#汽机泵运行，二期2#、4#电泵运行。3#高压给水泵监护运行，2#、4#高压给水泵前轴漏油，发电机二次脉冲油油管漏待修,烟气脱硫运行，1#高加水侧出口阀漏。', '空分运行，产量35000NM3/h，负荷88%，气化A炉3.87MPa运行，O/C 0.67，负荷97.5%，气化B炉3.86MPa运行，O/C 0.74，负荷102%。9:00气化A煤仓上煤改为神木煤，22:50气化A炉漏量加大，盘管密度降至360KG/M3，降负荷至93%，23:26加A炉负荷至99%。', '合成负荷59%，精馏负荷59%，PSA进气量29000NM3/h，外送CO 70000Nm/h、H2 15000Nm/h。8:50硫回收停车，11:20 PSA氢气吸附塔A塔10阀电磁阀坏，引起系统工况波动，外送H2流量下降，13:30氢气吸附塔A塔切至L塔，14:26A塔10阀检修结束，14:00-15:30 PSA进气量减至30000NM3/H，15:35置换气缓冲罐HV-2009自调阀膜片坏，21:00HV2009阀检修完毕投用。CO真空泵9台运行(C/D/E/F/I/K/M/N/P)，6台备用（A/G/H/L/O/J），1台待检(B)。', 'songlina', '宋丽娜', '2013-03-08 09:56:56', '负荷30%运行。1:00 CO产品气中CH4含量2%。');
INSERT INTO sc_rzs VALUES ('2013-03-08', '热电1-3#锅炉运行，产汽340t/h，负荷75%，发电机组运行，发电量11000KW.H/H，负荷44%，脱盐水1#、2#、3#RO运行，水箱液位 8.3m，循环水一期1-3#汽机泵运行，二期2#、4#电泵运行。3#高压给水泵监护运行，2#、4#高压给水泵前轴漏油，发电机二次脉冲油油管漏待修,1#高加水侧出口阀漏。5:30-6:40 2.5MPa蒸汽进高加总进汽阀自动关闭，18:00因脱硫循环泵1#泵轴段停烟气脱硫。', '空分运行，产量33000NM3/h，负荷82.5%，气化A炉3.91MPa运行，O/C 0.69，负荷100%，气化B炉3.90 MPa运行，O/C 0.71，负荷102%。6:17-7:09气化B炉1#煤线断煤，负荷降至14400NM3/h,10:00 A炉上煤改为神木煤:水帘洞煤为2:1，18:41气化A炉激冷水泵A泵流量低160m3/h，启P1303B泵，双泵运行，P1301B泵机封漏，监护运行。', '净化气中总硫超标，低温甲醇洗优化工况，合成负荷59%，精馏负荷59%，PSA进气量22000NM3/h，外送CO 60000Nm/h、H2 11000Nm/h。1:00低温甲醇洗硫浓缩加大，1:20 PSA进气量降至24000NM3/h，4:00降至22000NM3/h，10:45 PSA系统HV2007阀坏隔离检修，16:20 HV2007阀回装完毕投用，CO真空泵6台运行(C/D/F/I/M/P)，9台备用（A/C/G/H/L/O/J/K/N），1台待检(B)。', 'songlina', '宋丽娜', '2013-03-09 09:31:31', '负荷：30%，CO：6000NM3/h，H2：14000NM3/h，O2：1300NM3/h，1:00 CO产品气中CH4为1.34%');
INSERT INTO sc_rzs VALUES ('2013-03-09', '热电1-3#锅炉运行，产汽340t/h，负荷75%，发电机组运行，发电量12000KW.H/H，负荷48%，脱盐水1#、2#RO运行，水箱液位 8.3m，2:00 3#RO化学清洗，循环水一期1-3#汽机泵运行，二期2#、4#电泵运行。3#高压给水泵监护运行，2#、4#高压给水泵前轴漏油，发电机二次脉冲油油管漏待修,1#高加水侧出口阀漏。4:40-20:30因脱硫塔循环泵机封漏水停烟气脱硫，22:30因B脱硫塔循环泵轴断停烟气脱硫。', '空分运行，产量33000NM3/h，负荷82.5%，气化A炉3.91MPa运行，O/C 0.69，负荷100%，气化B炉3.90 MPa运行，O/C 0.71，负荷102%。21:45-22:10因变换S-2001液位高，气化双炉负荷调整,10:00 A炉上煤改为神木煤:水帘洞煤为1:1，P1301B泵机封漏，监护运行。', '净化气中总硫超标，低温甲醇洗优化工况，合成负荷59%，精馏负荷59%，9:00 PSA进气量加至26000NM3/h，外送CO 7000Nm/h、H2 15000Nm/h，CO真空泵6台运行(C/D/F/I/M/P)，9台备用（A/C/G/H/L/O/J/K/N），1台待检(B)。1:20因1#置换气压缩机2段缸撞缸倒为2#机，20:001#置换气压缩机修好待试，21:00净化气总硫含量超标：COS: 0.2PPM', 'songlina', '宋丽娜', '2013-03-10 09:32:40', '负荷：30%,CO:7000NM3/h，H2：15000NM3/h，O2：1580NM3/h，01：00  CO产品其中CH4为1.3%');
INSERT INTO sc_rzs VALUES ('2013-03-10', '热电1-3#锅炉运行，产汽340t/h，负荷75%，发电机组运行，发电量15000KW.H/H，负荷60%，脱盐水1#、2#、3#RO运行，水箱液位 7.3m，循环水一期1-3#汽机泵运行，二期2#、4#电泵运行。3#高压给水泵监护运行，2#、4#高压给水泵前轴漏油，发电机二次脉冲油油管漏待修,1#高加水侧出口阀漏。烟气脱硫:B脱硫塔循环泵检修，系统停车。事故水池液位：距上沿1.6M。', '空分运行，产量33000NM3/h，负荷82.5%，气化A炉3.91MPa运行，O/C 0.70，负荷100%，气化B炉3.90 MPa运行，O/C 0.71，负荷101%。11:37 气化A炉激冷水量降至164Nm3/h，氧量降至138000NM3/h，12:40负荷恢复至100%，17:38气化A炉激冷水量升至209Nm3/h。1:00 A炉渣口压差:66Kpa，B炉渣口压差:30Kpa;P1303A、B出口流量:219M3/H,P1303D出口流量:199M3/H。P1301B泵机封漏，监护运行。', '合成负荷：72%，精馏负荷：72%，3:20 2#二氧化碳压缩机因油泵电流高跳车，启4#二氧化碳压缩机，净化气中总硫超标，低温甲醇洗优化工况，13:00 PSA进气量加至33000NM3/h，23:10 PSA进气量减至31000NM3/h。外送CO 8000Nm/h、H2 18000Nm/h，CO真空泵6台运行(C/D/F/I/M/P)，9台备用（A/C/G/H/L/O/J/K/N），1台待检(B)。22:45-23:35 1#置换气压缩机试机备用，22:30 2#二氧化碳压缩机油泵回装，电流较高，21:00净化气总硫含量超标：COS: 0.26PPM。', 'songlina', '宋丽娜', '2013-03-11 08:56:45', 'CO:8500,O2：1800,H2：18000,负荷：40%，1:00分析CO产品气中CH4含量为1.58%。');
INSERT INTO sc_rzs VALUES ('2013-03-11', '热电1-3#锅炉运行，产汽380t/h，负荷85%，发电机组运行，发电量14000KW.H/H，负荷60%，脱盐水1#、3#RO运行，水箱液位 7.8m，循环水一期电泵、2#、3#汽机泵运行，二期2#、4#电泵运行。3#高压给水泵监护运行，2#、4#高压给水泵前轴漏油，发电机二次脉冲油油管漏待修,1#高加水侧出口阀漏。烟气脱硫脱硫塔循环泵检修。事故水池液位：距上沿1.3M。', '空分运行，产量20269NM3/h，负荷505%。气化B炉3.79 MPa运行，O/C 0.73，负荷100%。1:00 B炉渣口压差:31Kpa;P1303D出口流量:195M3/H。P1303B机封泄漏，正在检修。3:20 因气化13TIA1011D温度点升至2530C，气化A炉减氧量至13800NM3/h，4:50气化A炉氧量加至15500NM3/h，7:25气化B炉捞渣机刮板脱落，排渣走临时管线,8:40 B捞渣机修复投用。9:30 气化A炉因合成气出口温度高联锁跳车。21:28-21:37 C系列磨煤系统S1103C反吹、X1104C、X1105C、X1103D跳，无法启动，联系仪表处理。', '合成负荷：72%，精馏负荷：72%， PSA进气量30000NM3/h,外送CO 8000Nm3/h、H2 16000Nm3/h，CO真空泵6台运行(C/D/F/I/M/P)，9台备用（A/C/G/H/L/O/J/K/N），1台待检(B)。21:00净化气总硫含量超标：COS: 0.14PPM。12:16 合成补高压氮气，12:40 3#二氧化碳压缩机停运。14:45低温甲醇洗停止硫浓缩。', 'songlina', '宋丽娜', '2013-03-12 09:03:29', 'CO：8000Nm3/h，H2：18000Nm3/h，O2：1900Nm3/h，负荷：40%，1:00分析CO产品气CH4含量0.88%。');
INSERT INTO sc_rzs VALUES ('2013-03-12', '热电1-3#锅炉运行，产汽380t/h，负荷85%；发电机组运行，发电量14000KW.H/H，负荷60%；脱盐水1#、3#RO运行，水箱液位 7.5m；循环水一期2#、3#汽机泵运行，16:50停电泵，二期2#、4#电泵运行。3#高压给水泵监护运行，2#、4#高压给水泵前轴漏油，发电机二次脉冲油油管漏待修,1#高加水侧出口阀漏。烟气脱硫脱硫塔循环泵检修。事故水池液位：距上沿1.8M', '空分运行，产量20229NM3/h，负荷50%。气化A炉检修，B炉3.81 MPa运行，O/C 0.72，负荷100%。1:00 B炉渣口压差:29Kpa;P1303D出口流量:200M3/H。3:16气化1303B机封检修完毕；23:17因C套磨煤系统给煤机清扫链故障，启动A套磨煤系统。截止1:00A炉检修情况：烧嘴正在拆卸、气化炉人孔剩四根螺栓未拆，破渣机拆掉一半，C给煤机清扫链检修', '合成负荷：20%，精馏负荷：20%，硫回收二反升温， PSA进气量30000NM3/h,外送CO 8000Nm3/h、H2 16000Nm3/h，CO真空泵6台运行(C/D/F/I/M/P)，9台备用（A/C/G/H/L/O/J/K/N），1台待检(B)。净化气合格：COS: 0.08PPM。19:45 去气化驰放气倒为净化气，合成停止补氮气', 'songlina', '宋丽娜', '2013-03-13 09:55:10', '乙二醇40%负荷运行。');
INSERT INTO sc_rzs VALUES ('2013-03-13', '热电1-3#锅炉运行，产汽360t/h，负荷80%；发电机组运行，发电量16000KW.H/H，负荷64%；脱盐水1#RO运行，水箱液位 7.8m；循环水一期2#、3#汽机泵运行，二期2#、4#电泵运行。3#高压给水泵监护运行，2#、4#高压给水泵前轴漏油，发电机二次脉冲油油管漏待修,1#高加水侧出口阀漏。烟气脱硫脱硫塔循环泵1#泵试车完成，2#、3#泵机封漏检修。1#、3#炉引风机振动大，事故水池液位：距上沿1.4M。', '空分运行，产量20221NM3/h，负荷50%。气化A炉检修，B炉3.84 MPa运行，O/C 0.71，负荷100%。截止1:00 A炉检修情况：气化炉人孔已拆开，烧嘴及破渣机螺栓已拆掉，22:50 C给煤机清扫链检修完成。', '合成负荷：20%，硫回收二反升温， PSA进气量30000NM3/h,外送CO 8000Nm3/h、H2 19000Nm3/h，CO真空泵6台运行(C/D/F/I/M/P)，9台备用（A/C/G/H/L/O/J/K/N），1台待检(B)。19:40因解析气缓冲罐压力高至50kpa，导致CO纯度波动一次。22:15酸性气进硫回收系统开车。21:00净化气分析COS：0.24ppm。', 'songlina', '宋丽娜', '2013-03-14 09:29:28', '40%负荷运行。');
