INSERT INTO sc_rzs VALUES ('2013-03-23', '热电1#、3#锅炉运行，产汽270t/h，负荷90%；脱盐水1#RO运行，脱盐水箱液位8.4M；循环水一期2#汽机泵运行，00:53开电泵，0:55停3#汽机泵，二期2#、4#电泵运行，00:25锅炉2#爆管，00:28发电机减负荷，24日1:20分2#炉切汽停炉，24日1:30发电机停车。3#高压给水泵监护运行，2#、4#高压给水泵前轴漏油；1#炉引风机振动大，监护运行；发电机二次脉冲油油管漏待修；1#高加水侧出口阀漏；1#炉一次风机、2#炉一次风机、二次风机风道漏；3#炉引风机振动大；事故水池液位：距上沿2.2M。', '空分运行，产量21100NM3/h，负荷53%；00:26--1:20启动事故氮泵。气化A炉检修，B炉3.8MPa运行，氧煤比0.7，负荷100%。截止00:00 A炉检修情况：气化炉炉膛打渣。', '甲醇工况调整，净化气合格。PSA进气量40000NM3/h，外送CO：11000Nm3/h、H2：24000Nm3/h，CO真空泵6台运行(D/E/F/I/M/P)，8台急备（A/C/K/G/H/L/O/N/J），2台待检(B/K)。21:00净化气分析COS：0.06ppm。10:30因闪蒸气压缩机电机有异响，停机检查，14:30 CO2压缩机4#机检修完成，00:27精馏停车，24日1:15--2:37 PSA系统减负荷至20000Nm3/h。', 'songlina', '宋丽娜', '2013-03-24 09:41:41', '0:26-1:20乙二醇精馏停车；00:43 酯化系统切氧，CO放空；4:40 乙二醇精馏开车。');
INSERT INTO sc_rzs VALUES ('2013-03-24', '热电1#、3#锅炉运行，产汽270t/h，负荷90%，2#锅炉检修，汽轮发电机停运；脱盐水1#RO运行，脱盐水箱液位8.1M；循环水一期2#汽机泵、电泵运行二期2#、4#电泵运行，9:56 3#高压给水泵停机检修机封，2#、4#高压给水泵前轴漏油；1#炉引风机振动大，监护运行；1#高加水侧出口阀漏；1#炉一次风机风道漏；3#炉引风机振动大；事故水池液位：距上沿2.8M。12:50向金天化工送3.8MPa蒸汽。', '空分运行，产量21100NM3/h，负荷53%；气化A炉检修，B炉3.8MPa运行，氧煤比0.7，负荷100%。截止0:00A炉检修情况：气化炉已装好激冷环。', '甲醇工况调整，净化气合格，合成45%负荷,11:00精馏系统开车，闪蒸气压缩机电机准备检查，15:00 4#CO2压缩机试车，运行正常，16:00停1#CO2压缩机。8:17 PSA开始减负荷，9:20 CO压缩机停车，停止向乙二醇送CO产品气，至10:40 PSA停车查漏，停止向乙二醇送H2产品气,21:00 PSA查漏结束共查出108个阀门内漏，16:10 预处理与H2吸附系统充氮置换。', 'songlina', '宋丽娜', '2013-03-25 10:22:08', '9:50 C-201机组因入口缓冲罐液位高联锁跳车，10:40停止接收H2产品气。');
INSERT INTO sc_rzs VALUES ('2013-03-25', '热电1#、3#锅炉运行，产汽230t/h，负荷76%，2#锅炉检修，汽轮发电机停运；脱盐水1#、2#RO运行，脱盐水箱液位8.2M；循环水一期2#汽机泵、电泵运行，二期2#电泵运行，2#、4#高压给水泵前轴漏油；1#炉引风机振动大，监护运行；1#高加水侧出口阀漏；1#炉一次风机风道漏；3#炉引风机振动大；10:30向金天化工送3.8MPa蒸汽。', '空分运行,9:24-9:30进口膨胀机跳车（膨胀机振动高），产量20000NM3/h，负荷50%；气化A炉检修，B炉3.8MPa运行，氧煤比0.7，负荷100%。截止0:00A炉检修情况：激冷环与下降管进行第一遍焊接。', '甲醇工况调整，净化气合格，合成45%负荷,精馏系统运行。 PSA系统置换。', 'songlina', '宋丽娜', '2013-03-26 10:05:29', '加氢系统、合成系统氮气置换。');
INSERT INTO sc_rzs VALUES ('2013-03-26', '热电1#、3#锅炉运行，产汽230t/h，负荷76%，2#锅炉检修，汽轮发电机停运；脱盐水1#、2#RO运行，脱盐水箱液位8.2M；循环水一期2#汽机泵、电泵运行，二期2#电泵运行，2#、4#高压给水泵前轴漏油；1#炉引风机振动大，监护运行；1#高加水侧出口阀漏；1#炉一次风机风道漏；3#炉引风机振动大；10:30向金天化工送3.8MPa蒸汽。', '空分运行，产量20000NM3/h，负荷50%；气化A炉检修，B炉17:30停车。截止0:00A炉检修情况：激冷环与下降管进行焊接。', '15:00甲醇系统切气，16:15氨压缩停车，20:10合成压缩停车，变换、净化、合成氮气置换，精馏煮塔， PSA系统置换。', 'songlina', '宋丽娜', '2013-03-27 08:50:25', '系统停车，');
INSERT INTO sc_rzs VALUES ('2013-03-27', '6:45金天化工开始退3.8MPa蒸汽，9：23 3#锅炉停运解列，15:00 2期循环水泵停止，17:35 2#汽轮机泵停机，18:15 1#锅炉停运，20:45循环水电泵停运，循环水池排水。脱盐水水箱水位8.35m，暂停制水。', '空分12:40启事故氮泵，13:00开始减负荷，13:45空压机组停运，17:40系统排液结束。气化停车检修，A炉打磨盘管。', '停车检修，7:50精馏煮塔结束，停车；13:00 PSA置换结束。', 'songlina', '宋丽娜', '2013-03-28 08:31:30', '停车检修。');
INSERT INTO sc_rzs VALUES ('2013-03-28', '热电1-3#锅炉运行，产汽340t/h，负荷75%，发电机组运行，发电量12500KW.H/H，负荷50%，脱盐水1#、2#、3#RO运行，水箱液位7.8m，循环水一期1-3#汽机泵运行，二期2#、4#电泵运行。3#高压给水泵监护运行，发电机二次脉冲油油管漏待修。', '空分运行，产量37000NM3/h，负荷93%，气化A炉3.86MPa运行，O/C 0.70，负荷101%，气化B炉3.89MPa运行，O/C 0.71，负荷102%。', '4:38合成压缩机误操作机组停车，5:40恢复；6:00PSA装置CO在线纯度下降至92%，永金切气放空,8:00-10:00 PSA进气量减至20000NM3/H;10:43合成气压缩机喘振，入口安全阀起跳，11:45安全阀恢复。16:30--18:30 P-2002A/S清洗进口过滤器,21:00净化气总硫超标。', 'songlina', '宋丽娜', '2013-03-01 10:33:47', '06:00因CO纯度下降切气退氧，08:25氧气引入界区，14:50 CO进系统，20:30羰化加氢。');
INSERT INTO sc_rzs VALUES ('2013-04-26', '23日9:00点2#锅炉，26日2#锅炉、脱盐水、循环水运行正常。', '24日18:55空分空压机组开始冲转。26日空分运行正常，气化A炉回装烧嘴，煮炉，B炉烘炉，煮炉', 'PSA做气密，变换升温。', 'songlina', '宋丽娜', '2013-04-30 11:09:50', null);
INSERT INTO sc_rzs VALUES ('2013-04-27', '27日9:00点3#锅炉，现2#、3#锅炉、脱盐水、循环水运行正常。', '气化A炉14:30气密结束，B炉烘炉。', 'PSA消漏，变换升温。', 'songlina', '宋丽娜', '2013-04-30 11:10:59', null);
INSERT INTO sc_rzs VALUES ('2013-04-28', '热电2、3#锅炉运行，产汽260t/h，负荷86%；00:25发电汽轮机冲转，5:27汽轮机2#、3#轴瓦振动大跳车，16:00发电机再次冲转，19:30发电并网，发电量7000KW.H/H，负荷28%；脱盐水1#、2#、3#RO运行，水箱液位6.9m；循环水一期电泵、3#汽机泵运行，19:00循环水2#汽机泵并网，停1#泵（高位油箱逆止阀内漏），19:20启动二期2#电泵。3#高压给水泵检修机封。', '空分运行，产量20000NM3/h，负荷50%；气化A套5:45气化开始做煤循环，2#煤线堵，7:45 2#煤线恢复正常，12:10点火成功，12:53因13XV1004关闭A炉跳车，14:25再次点火，14:55投煤，17:20外送粗煤气暖管，21:30外送压力提至2.5MPa，O/C 0.68，负荷74%。气化B炉炉盖漏点检修，2#给煤机检修，气化A炉25B点温度常偏高（1000度左右）。', '2:40 合成气压缩机冲转，3:48-6:12 精馏因加压塔人孔漏停车；4:20 合成气压缩机带负荷，合成系统循环升温。17:20变换暖管，21:35变换接气，23:00低温甲醇洗接气，0:35两次净化气总硫未检出，合成接气。22:30精醇分析合格，精馏正常采出。PSA程序调试。', 'songlina', '宋丽娜', '2013-04-29 09:19:59', '合成充压，亚酯气回收系统气密。');
INSERT INTO sc_rzs VALUES ('2013-04-29', '热电1、2、3#锅炉运行，产汽285t/h，负荷63%，9:10 1#锅炉点火，14:55因1#锅炉包墙西侧下联箱漏压火，17:08养火，19:10并汽；发电机发电量9300KW.H/H，负荷37%；脱盐水1#、2#、3#RO运行，水箱液位7.7m；循环水一期21:00循环水1#汽机泵并网停电机泵，2#、3#汽机泵运行，二期2#电泵运行。', '空分运行，产量20000NM3/h，负荷50%；气化A炉负荷85%运行。气化B炉炉盖漏点检修，2#给煤机检修，气化A炉26A/B,27A点温度较高（1000度左右）。', '甲醇系统优化调整，净化气总硫超标(21:00 COS 0.15PPm)，合成负荷43%，硫回收燃烧炉升温，当前温度410℃，30日1:41 PSA接气开车。', 'songlina', '宋丽娜', '2013-04-30 11:08:16', '19:40 C201机组冲转，21:17运行正常。');
INSERT INTO sc_rzs VALUES ('2013-04-30', '热电1-3#炉运行，产汽300T/h，负荷67%，发电机运行，发电量11000KW.H/H，负荷44%，脱盐水2#、3#RO运行，水箱液位7.8m，循环水一期1-3#汽机泵运行，二期2#电泵，18:27 1#锅炉西包墙管堵漏结束，19:30热电4层半疏水漏点堵漏结束，22:00回收乙二醇溴化锂机组冷凝液。一期循环水系统继续预膜。', '空分运行，产量20000NM3/h，负荷50%；21:10气化A炉负荷加至100%，气化B炉烧嘴安装，13:00 气化洗涤塔补水倒为变换冷凝液，2#给煤机检修。', '甲醇系统优化调整，净化气总硫合格，合成负荷43%，硫回收燃烧炉480度恒温，一反、二反升温，目前温度一反115度，二反220度，废锅、一硫冷、二硫冷煮锅，1:41PSA进气5000NM3/H，16:22进气量提至19000NM3/h，19:40进气量降至12000NM3/h。', 'songlina', '宋丽娜', '2013-05-01 10:18:44', 'C-201机组运行，合成升温，加氢系统气密消漏。');
INSERT INTO sc_rzs VALUES ('2013-05-01', '热电1-3#炉运行，产汽325T/h，负荷72%，发电机运行，发电量10800KW.H/H，负荷43%，脱盐水2#、3#RO运行，水箱液位7.47m，循环水一期1-3#汽机泵运行，二期2#电泵，14:40一期循环水系统开始置换。', '空分运行，产量20000NM3/h，负荷50%；气化A炉负荷100%，17:58气化B炉气密结束，22:44气化启C磨磨煤，00:35气化B炉点火，2日1:30B#炉投煤成功，2:00因P1303D泵体有噪音，且入口过滤器堵塞，无法隔离，遂停B#炉。2#给煤机检修。', '甲醇净化气总硫合格，合成负荷50%，硫回收燃烧炉保温，14:00PSA停车检修阀门内漏（共15台阀）。2日4:35 PSA系统开始重新进气。', 'songlina', '宋丽娜', '2013-05-02 09:43:22', '脱氢系统保温保压，加氢系统气密，羰化置换。');
