INSERT INTO sc_rzs VALUES ('2013-05-31', '热电2#、3#炉运行，产汽235T/h，发电负荷6500KW.H/H,脱盐水3#RO运行，脱盐水箱液位8.3m，循环水一期1#、2#、3#汽机泵运行，09:00启运二期循环水2#电泵，系统置换。09:45 2#锅炉点火，12:50投煤，15:30并汽，16:44 1#锅炉压火，23:40 1#炉引风机漏点检修结束投运，23:53 1#锅炉养火升压。事故水池液位：离上沿2.1m。01:27-05:30给金天化工送蒸汽。', '空分运行正常，产氧量36000NM3/h；空分增压机推力轴承温度120.4℃,轴位移：0.52mm、0.54mm。B炉3.65MPa运行，O/C 0.63，氧量15500NM3/h。A炉：余8处盘管未焊接，继续打磨,抓钉已打约1/3。', '甲醇系统工况调整。21:00净化气分析：H2S:未检出、COS:0.06PPm。硫回收扫硫。01:00 PSA：G塔检修，R塔抽吸附剂（同盛已抽10包），J塔抽吸附剂（北大已抽30包）。', 'songlina', '宋丽娜', '2013-06-01 10:57:18', '停车检修。');
INSERT INTO sc_rzs VALUES ('2013-06-01', '热电1#、2#炉运行，产汽235T/h，发电负荷8500KW.H/H,脱盐水1#RO运行，脱盐水箱液位8.3m，循环水一期1#、2#、3#汽机泵运行，11:00停二期循环水2#电泵。1:55 1#锅炉并汽结束，2:50 3#锅炉停车，3#炉1#落煤管磨埙严重，白天处理。19:00 3#炉一次风机轴承漏油处理好。事故水池液位：离上沿2.1m', '空分运行正常，产氧量36000NM3/h；空分增压机推力轴承温度121℃,轴位移：0.52mm、0.54mm。B炉3.65MPa运行，O/C 0.63，氧量15500NM3/h。12:00 气化A炉开始做气密，0:00 4.0MPA气密无漏点', '甲醇系统工况调整。21:00净化气分析：H2S:未检出、COS:0.08PPm。硫回收尾气放空管线，精馏废水管线配管。 PSA：19:00G塔回装结束，20:00R塔吸附剂抽完，23:30J塔检修结束，F塔抽瓷球5包，M塔抽瓷球、吸附剂共58包。', 'songlina', '宋丽娜', '2013-06-02 08:31:16', '乙二醇停车检修。');
INSERT INTO sc_rzs VALUES ('2013-06-02', '热电1#、2#炉运行，产汽237T/h，发电负荷9000KW.H/H,脱盐水1#RO、2#RO运行，脱盐水箱液位7.6m，循环水一期1#、2#、3#汽机泵运行，09:00-11:00启二期循环水2#电泵。事故水池液位：离上沿2.2m。', '空分运行正常，产氧量36000NM3/h；空分增压机推力轴承温度122.5℃,轴位移：0.52mm、0.54mm。B炉3.65MPa运行，O/C 0.60，氧量15500NM3/h。04:00 A炉浇筑料涂抹结束。6月3日00:10气化A炉开始烘炉', '甲醇系统工况调整。21:00净化气分析：H2S:未检出、COS:未检出。硫回收尾气放空管线，精馏废水管线配管。 PSA：18:10 M塔吸附剂抽完，19:15 J塔回装结束，截止01:10 B塔抽同盛吸附剂8包，F塔抽北大吸附剂23包，M、R检修。', 'songlina', '宋丽娜', '2013-06-03 09:14:05', '停车检修。');
INSERT INTO sc_rzs VALUES ('2013-06-03', '热电1#、2#炉运行，产汽240T/h，发电负荷9000KW.H/H,脱盐水停车（添加非氧化杀菌剂），脱盐水箱液位5.46m，循环水一期1#、2#、3#汽机泵运行。23:00 因龙门煤不足，热电上煤改为水帘洞。事故水池液位：离上沿1.8m。', '空分运行正常，产氧量34500NM3/h；空分增压机推力轴承温度122.1℃,轴位移：0.52mm、0.54mm。B炉3.63MPa运行，O/C 0.60，氧量15500NM3/h。气化A炉烘炉,10:00 100℃恒温结束，开始升温。', '甲醇系统工况调整。21:00净化气分析：H2S:未检出、COS:0.05ppm。硫回收尾气放空管线配管，精馏废水管线配管结束。 PSA：B塔吸附剂抽完，截止00:50 Q塔抽同盛吸附剂7包，N塔抽同盛吸附剂14包，M塔开始装同盛吸附剂。', 'songlina', '宋丽娜', '2013-06-04 09:03:58', '停车检修。');
INSERT INTO sc_rzs VALUES ('2013-06-04', '热电1#、2#炉运行，产汽240T/h，发电负荷9000KW.H/H,15:102#高压给水泵倒为3#高压给水泵，检修2#高压给水泵（电机漏油），20:05 3#锅炉做完流化实验。脱盐水1#RO运行，脱盐水箱液位8.1m，循环水一期1#、2#、3#汽机泵运行，14:40 1#汽机泵（泵前轴承漏油）倒为电机泵 ,20:10一期循环水电泵倒为1#汽机泵（因缺备件未检修）。事故水池液位：离上沿2.3m。', '空分运行正常，产氧量34500NM3/h；空分增压机推力轴承温度122.8℃,轴位移：0.52mm、0.54mm。B炉3.63MPa运行，O/C 0.60，氧量15500NM3/h。气化A炉烘炉,18:00 230℃恒温结束，开始升温。', '甲醇系统工况调整。21:00净化气分析：H2S:未检出、COS:0.06ppm。14:58硫回收燃烧炉开始升温。 PSA：截止00:50 Q塔吸附剂已抽完，只剩瓷球，N塔同盛吸附剂抽完，北大吸附剂已抽34包。18：00 F塔吸附剂装填完毕', 'songlina', '宋丽娜', '2013-06-05 08:52:31', '乙二醇停车检修。');
INSERT INTO sc_rzs VALUES ('2013-06-05', '热电1#、2#炉运行，产汽240T/h，发电负荷8500KW.H/H。脱盐水1#RO运行，脱盐水箱液位8.2m，循环水一期1#、2#、3#汽机泵运行。8:45--14:55启动循环水二期2#电机泵，15:10因泵体排汽管泄漏停循环水一期2#汽机泵，启电机泵，21:25启2#汽机泵，停一期电泵。事故水池液位：离上沿2.6m。', '空分运行正常，产氧量34500NM3/h；空分增压机推力轴承温度122.4℃,轴位移：0.52mm、0.54mm。B炉3.63MPa运行，O/C 0.60，氧量15500NM3/h。气化A炉21:00 450℃恒温结束，开始降温。', '甲醇系统工况调整。21:00净化气分析：H2S:未检出、COS:0.06ppm。硫回收燃烧炉继续升温。 PSA：截止00:50 17:00 B塔吸附剂装填完毕，Q塔回装，N塔待装，C塔检修。', 'songlina', '宋丽娜', '2013-06-06 09:12:28', '乙二醇停车检修。');
INSERT INTO sc_rzs VALUES ('2013-06-06', '热电1#、2#炉运行，产汽260T/h，发电负荷9000KW.H/H。脱盐水1#、3#RO运行，脱盐水箱液位7.6m，循环水一期1#、2#、3#汽机泵运行。8:55--14:20循环水二期启动2#电机泵。事故水池液位：离上沿2.8m。', '空分运行正常，产氧量34500NM3/h；空分增压机推力轴承温度122.9℃,轴位移：0.52mm、0.54mm。B炉3.63MPa运行，O/C 0.60，氧量15500NM3/h。20:30气化A炉检修结束。', '甲醇系统工况调整。21:00净化气分析：H2S:未检出、COS:0.06ppm。硫回收继续升温。 PSA：22:00 检修结束开始用氮气吹扫 。', 'songlina', '宋丽娜', '2013-06-07 09:32:06', '乙二醇停车检修。');
INSERT INTO sc_rzs VALUES ('2013-06-07', '热电1#、2#炉运行，产汽250T/h，发电负荷9200KW.H/H。脱盐水1#、3#RO运行，脱盐水箱液位7.8m，循环水一期1#、2#、3#汽机泵运行。8:30--14:20循环水二期启动2#电机泵。事故水池液位：离上沿3.0m。1#锅炉引风机轴承漏油，2#脱硫塔循环泵轴承坏待检。', '空分运行正常，产氧量34500NM3/h；空分增压机推力轴承温度122.8℃,轴位移：0.52mm、0.54mm。B炉3.63MPa运行，O/C 0.60，氧量15500NM3/h。03:06气化A炉建立水循环。14:10气化A炉开始煮炉，0:50温度升至170℃。', '甲醇系统工况调整。21:00净化气分析：H2S:未检出、COS:0.07ppm。11:05因硫回收管线堵，燃烧炉停运。 截止01:00变压吸附气密2.0MPa查漏。', 'songlina', '宋丽娜', '2013-06-08 09:25:38', '停车检修。');
INSERT INTO sc_rzs VALUES ('2013-06-08', '热电1#、2#炉运行，产汽250T/h，发电负荷9800KW.H/H。脱盐水1#、2#RO运行，脱盐水箱液位7.7m，循环水一期1#、2#、3#汽机泵运行。8:30-12:00循环水二期启动2#电机泵。16:50 2#脱硫塔循环泵投运。事故水池液位：离上沿3.0m。', '空分运行正常，产氧量35900NM3/h；空分增压机推力轴承温度123℃,轴位移：0.53mm、0.55mm。       B炉3.63MPa运行，O/C 0.61，氧量15500NM3/h。', '甲醇系统工况调整。21:00净化气分析：H2S:未检出、COS:0.07ppm。 硫回收氮气扫硫、管线清堵。截止01:00变压吸附查漏情况共计查出18个阀门内漏。', 'songlina', '宋丽娜', '2013-06-09 10:16:05', '停车检修。');
INSERT INTO sc_rzs VALUES ('2013-06-09', '热电1#、2#、3#炉运行，产汽270T/h，3#锅炉20:14点火，22:40投煤，10日1:00并汽结束。发电负荷7000KW.H/H。脱盐水1#、2#RO运行，脱盐水箱液位7.4m，循环水一期1#、2#、3#汽机泵运行。9:50循环水二期启动2#电机泵。事故水池液位：离上沿3.0m。', '空分运行正常，产氧量35900NM3/h；空分增压机推力轴承温度122.8℃,轴位移：0.53mm、0.55mm。 A炉3.68MPa运行，O/C 0.61，氧量14000NM3/h，B炉3.75MPa运行，O/C 0.61，氧量15500NM3/h。10:53 A#炉点火，11:17投煤，22:15双炉开始并气运行。', '甲醇系统工况调整。21:00净化气分析：H2S:未检出、COS:未检出。 14:40硫回收燃烧炉点火。PSA:0:50剩2个程控阀检修。', 'songlina', '宋丽娜', '2013-06-10 09:13:25', '做开车准备。');
INSERT INTO sc_rzs VALUES ('2013-06-10', '热电1#、2#、3#炉运行，产汽280T/h，4:00 3#锅炉压火，6:20扬火，7：00并汽。发电负荷7000KW.H/H。脱盐水1#、2#、3#RO运行，脱盐水箱液位7.2m，循环水一期1#、2#、3#汽机泵运行,循环水二期2#电机泵运行。事故水池液位：离上沿3.0m。', '空分运行正常，产氧量35900NM3/h；空分增压机推力轴承温度123.4℃,轴位移：0.53mm、0.55mm。 A炉3.68MPa运行，O/C 0.61，氧量14000NM3/h，B炉3.75MPa运行，O/C 0.61，氧量15500NM3/h。高闪安全阀旁路火炬侧管线漏汽，需处理。', '甲醇系统工况调整。21:00净化气分析：H2S:未检出、COS:未检出，6:30硫回收接酸性气开车。PSA：5:50 进气开车，10:25 系统停车，18:00查出34个程控阀内漏。', 'songlina', '宋丽娜', '2013-06-11 08:37:35', '乙二醇：7:25 C-201冲转。脱氢升温至130℃，酯化升温至A：118℃。B:125℃。');
INSERT INTO sc_rzs VALUES ('2013-06-11', '热电1#、3#炉运行，产汽220T/h，17:10 2#锅炉停炉。发电负荷5000KW.H/H。脱盐水2#RO运行，脱盐水箱液位8.4m，循环水一期1#、2#、3#汽机泵运行,循环水二期2#电机泵运行,22:30停2#电机泵。事故水池液位：离上沿3.2m。', '空分运行正常，产氧量35900NM3/h；空分增压机推力轴承温度122.5℃,轴位移：0.53mm、0.55mm。 A炉3.75MPa运行，O/C 0.63，氧量14000NM3/h，B炉3.8MPa运行，O/C 0.63，氧量15500NM3/h。高闪安全阀旁路火炬侧管线漏点加固。', '甲醇系统工况调整。21:00净化气分析：H2S:未检出、COS:未检出。8:30 PSA接气开车，16:40 PSA因CO纯度下降切气停车。', 'songlina', '宋丽娜', '2013-06-12 09:28:29', '17：13停C201机组。系统停车。');
