INSERT INTO sc_rzs VALUES ('2013-06-13', '热电1#、3#炉运行，产汽255T/h。发电负荷10000KW.H/H。脱盐水1#RO运行，脱盐水箱液位8.3m，循环水一期1#、2#、3#汽机泵运行。事故水池液位：离上沿3.5m。', '空分运行正常，产氧量35900NM3/h；空分增压机推力轴承温度123.3℃,轴位移：0.53mm、0.55mm。 A炉23:13跳车。', '23:13因气化跳车，甲醇系统停车。', 'songlina', '宋丽娜', '2013-06-14 09:08:53', '系统停车');
INSERT INTO sc_rzs VALUES ('2013-06-14', '热电1#、3#炉运行，产汽255T/h。发电负荷10000KW.H/H。脱盐水1#RO运行，脱盐水箱液位8.0m，循环水一期1#、2#、3#汽机泵运行。事故水池液位：离上沿3.5m。', '空分运行正常，产氧量35900NM3/h；空分增压机推力轴承温度123℃,轴位移：0.53mm、0.55mm。A炉3.66MPa运行，O/C 0.62。4:00 气化A炉点火，4:55投煤，5:36向变换送气。', '甲醇系统工况调整。5:36变换接气，6:30低温甲醇洗接气，12:40合成接气。21:00硫回收燃烧炉点火，PSA 程控阀检修，截止23:00已有43台装好，42台就位未上丝，35台未就位。', 'songlina', '宋丽娜', '2013-06-15 08:50:15', '系统停车');
INSERT INTO sc_rzs VALUES ('2013-06-15', '热电1#、3#炉运行，产汽255T/h。发电负荷10700KW.H/H。脱盐水1#RO、2#RO运行，脱盐水箱液位7.4m，循环水一期1#、2#、3#汽机泵运行。', '空分运行正常，产氧量36000NM3/h；空分增压机推力轴承温度122.9℃,轴位移：0.53mm、0.55mm。A炉3.2MPa运行，O/C 0.60。10:30气化A炉因ESD故障跳车，13:58 A炉点火，14:23 A炉投煤。', '甲醇系统工况调整。10:30因气化炉跳车，系统停车，15:08 变换接气。16:00低温甲醇洗接气，23:10合成接气。 PSA 程控阀查漏检修(M、P塔已完成)。', 'songlina', '宋丽娜', '2013-06-16 09:11:10', '系统停车');
INSERT INTO sc_rzs VALUES ('2013-06-16', '热电1#、3#炉运行，产汽260T/h。发电负荷10300KW.H/H。脱盐水1#RO运行，脱盐水箱液位8.3m，循环水一期1#、2#、3#汽机泵运行。9:20-12:20二期循环水2#电泵运行。23:55因脱硫1#、3#循环泵电流高，2#循环泵出口法兰漏量大，锅炉退烟气脱硫。00:55 3#烟气脱硫循环泵修好投运，1#、3#炉锅炉投烟气脱硫', '空分运行正常，产氧量36000NM3/h；空分增压机推力轴承温度123.8℃,轴位移：0.53mm、0.55mm。A炉3.58MPa运行，O/C 0.61。P1406C返厂检修。', '甲醇系统工况调整。10:30硫回收酸性气进燃烧炉。18:30因1#CO2压缩机电机轴承温度高（71.2℃）倒3#运行。PSA系统阀门复查：内漏阀门共（58个）。', 'songlina', '宋丽娜', '2013-06-17 09:36:46', '系统停车');
INSERT INTO sc_rzs VALUES ('2013-06-17', '热电1#、3#炉运行，产汽260T/h。发电负荷8000KW.H/H，烟气脱硫运行正常。脱盐水1#、2#、3#RO运行，脱盐水箱液位8.1m，循环水一期1#、2#、3#汽机泵运行。21:00由于3#锅炉断煤严重，上煤改为 新桥煤：水帘洞煤= 1:1', '空分运行正常，产氧量36000NM3/h；空分增压机推力轴承温度122.8℃,轴位移：0.53mm、0.55mm。空压机出口法兰带压堵漏后仍漏。A炉3.58MPa运行，O/C 0.61。', '甲醇系统运行正常，净化气合格。1#CO2压缩机急备。PSA系统: 0:00程控阀检修完毕，系统开始充压气密查漏。', 'songlina', '宋丽娜', '2013-06-18 09:31:13', '系统停车');
INSERT INTO sc_rzs VALUES ('2013-06-18', '热电1#、3#炉运行，产汽250T/h。发电负荷8000KW.H/H，烟气脱硫运行正常。脱盐水1#、2#RO运行，脱盐水箱液位7.4m，循环水一期1#、2#、3#汽机泵运行。8:20-14:00二期循环水2#电泵运行。', '空分运行正常，产氧量36000NM3/h；空分增压机推力轴承温度122.7℃,轴位移：0.53mm、0.55mm。A炉3.58MPa运行，O/C 0.61。', '甲醇系统运行正常，净化气合格。1#CO2压缩机检修。PSA系统: 截止19日0:30查出16台程控阀漏量较大。', 'songlina', '宋丽娜', '2013-06-19 09:34:50', '系统停车');
INSERT INTO sc_rzs VALUES ('2013-06-19', '热电1#、3#炉运行，产汽258T/h。发电负荷10000KW.H/H，烟气脱硫运行正常,已产出硫酸铵产品。脱盐水1#、2#、3#RO运行，脱盐水箱液位7.5m，循环水一期1#、2#、3#汽机泵运行。', '空分运行正常，产氧量36000NM3/h；空分增压机推力轴承温度122.6℃,轴位移：0.53mm、0.55mm。A炉3.5MPa运行，O/C 0.63。', '甲醇系统运行正常，净化气合格。1#CO2压缩机检修。20:00 PSA阀门检修完毕，系统开始充压。', 'songlina', '宋丽娜', '2013-06-20 09:17:01', '系统停车');
INSERT INTO sc_rzs VALUES ('2013-06-20', '热电1#、3#炉运行，产汽258T/h。发电负荷10000KW.H/H，烟气脱硫运行正常。脱盐水1#、2#、3#RO运行，脱盐水箱液位8.1m，循环水一期1#、2#、3#汽机泵运行。PSA控制室西北处高压消防水管线漏点需继续处理。21日1:00启二期循环水2#电泵。3:30 3#锅炉1#落煤管电动插板阀电机烧坏，因无备件，将2#锅炉的拆卸安装到3#炉。', '空分运行正常，产氧量36000NM3/h；空分增压机推力轴承温度122.3℃,轴位移：0.53mm、0.55mm。A炉3.5MPa运行，O/C 0.63。P1406C检修中。', '甲醇系统运行正常，净化气合格，硫回收运行正常，精馏系统间歇运行，产品酸度偏高（酸度：0.0026）。20:00 PSA消漏结束，21:30系统开始走程序。21日2:50PSA系统接净化气开车，6:40启1#解析气压缩机', 'songlina', '宋丽娜', '2013-06-21 09:04:11', '系统停车。');
INSERT INTO sc_rzs VALUES ('2013-06-21', '热电1#、2#、3#炉运行，产汽314T/h。发电负荷10000KW.H/H，烟气脱硫运行正常。脱盐水1#、2#、3#RO运行，脱盐水箱液位7.5m，循环水一期1#、2#、3#汽机泵运行。12:55 2#锅炉点火，15:48连续投煤。18:35 2#锅炉并入管网运行；23:40 3#锅炉一号给煤机插板阀修复投运；16:00 2#锅炉改上新桥煤，1#、3#炉上水帘洞煤。', '空分运行正常，产氧量36000NM3/h；空分增压机推力轴承温度122.8℃,轴位移：0.53mm、0.55mm。A炉3.5MPa运行，O/C 0.63。', '甲醇系统运行正常，净化气合格。2:50 PSA接气。11:10因2#解析气压缩机一段缸撞缸，停机检修；24:00 启CO压缩机；PSA进气量15000M3/h。22日1:20PSA切气查漏,1:30停CO压缩机。', 'songlina', '宋丽娜', '2013-06-22 09:04:21', '19:24 乙二醇C201机组冲转；');
INSERT INTO sc_rzs VALUES ('2013-06-22', '热电1#、2#炉运行，产汽254T/h。发电负荷10000KW.H/H，烟气脱硫运行正常。脱盐水1#、2#、3#RO运行，脱盐水箱液位8.4m，循环水一期1#、2#、3#汽机泵运行。10:00停3#锅炉。12:34停2#高压给水泵。', '空分运行正常，产氧量36000NM3/h；空分增压机推力轴承温度122.8℃,轴位移：0.53mm、0.55mm。A炉3.5MPa运行，O/C 0.63。', '甲醇系统运行正常，净化气合格。17:00 PSA进气，系统调纯，进气量5000NM3/h。', 'songlina', '宋丽娜', '2013-06-23 08:53:13', '9:30停C201机组。');
